import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import DashboardPage from './pages/DashboardPage';
import ContractMessagePage from './pages/ContractMessagePage';
import ContractMessageDetails from './pages/ContractMessageDetailsPage';
import SettingImagesPages from './pages/SettingImagesPages';
import BlogPostCreatePage from './pages/BlogPostCreatePage';
import BlogPostListViewPage from './pages/BlogPostViewPage';
import UserPage from './pages/UserPage';
import UserRegistrationPage from './pages/UserRegistrationPage';
import UserLogin from './components/Users/Login';
import SecureLogIn from './components/Users/SecureLogIn';

import './styles.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<UserLogin />} />
        <Route path="/Dashboard" element={<DashboardPage />} />
        <Route path="/all-messages" element={<ContractMessagePage />} />
        <Route path="/message/:id" element={<ContractMessageDetails />} />
        <Route path="/setting/imagelibrary" element={<SettingImagesPages />} />
        <Route path="/blog/ListView" element={<BlogPostListViewPage />} />
        <Route path="/blog/create" element={<BlogPostCreatePage />} />
        <Route path="/users" element={<UserPage />} />
        <Route path="/users/create" element={<UserRegistrationPage />} />
      </Routes>
    </Router>
  );
}

export default App;
